import React, { useState, useRef } from 'react';
import CsvUploader from './components/CsvUploader';
import Header_Interpret from './components/header_interpret'; // Don't forget to import this
import logo from './logo.svg';
import './App.css';

function App() {
  const [csvHeaders, setCsvHeaders] = useState([]);
  const [showInterpretations, setShowInterpretations] = useState(false);
  const headerInterpretRef = useRef(null);

  const handleInterpretHeaders = () => {
    setShowInterpretations(true);
    headerInterpretRef.current?.interpretHeaders(); // Call the interpretHeaders method from Header_Interpret
  };

  return (
    <div className="app-container">
      <header className="app-header">
        <img src={logo} className="app-logo" alt="logo" />
        <h1>CSV and OpenAI Integration</h1>
      </header>
      <div className="app-content">
        <CsvUploader setCsvHeaders={setCsvHeaders} csvHeaders={csvHeaders} />
        <button onClick={handleInterpretHeaders}>Interpret Headers</button> {/* New Button */}
        {showInterpretations && <Header_Interpret ref={headerInterpretRef} csvHeaders={csvHeaders} />} {/* Conditionally render */}
      </div>
    </div>
  );
}

export default App;
